// src/pages/Features.js
import React from 'react';
import styled from 'styled-components';

// Container for centering content
const FeaturesContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  min-height: 60vh;  // Adjust as needed
  text-align: center;  // Center text within the container
  padding: 20px;
`;

const Title = styled.h1`
  font-size: 2.5em;
  margin-bottom: 20px;
  color: #333;
`;

const Description = styled.p`
  font-size: 1.2em;
  margin-bottom: 40px;
  color: #666;
`;

const FeatureGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(8, 1fr);  // 8 columns in the grid
  gap: 20px;
  width: 100%;
  max-width: 1200px;

  // Responsive adjustments
  @media (max-width: 1200px) {
    grid-template-columns: repeat(3, 1fr);  // 3 columns on smaller screens
  }

  @media (max-width: 800px) {
    grid-template-columns: repeat(2, 1fr);  // 2 columns on even smaller screens
  }

  @media (max-width: 500px) {
    grid-template-columns: repeat(1, 1fr);  // 1 column on mobile screens
  }
`;

const FeatureCard = styled.div`
  background-color: #ffffff;
  border-radius: 12px;
  padding: 20px;
  box-shadow: 0 8px 12px rgba(0, 0, 0, 0.1);
  transition: transform 0.3s ease, box-shadow 0.3s ease;

  &:hover {
    transform: translateY(-10px);
    box-shadow: 0 16px 24px rgba(0, 0, 0, 0.2);
  }
`;

const FeatureTitle = styled.h3`
  font-size: 1.5em;
  margin-bottom: 10px;
  color: #222;
`;

const FeatureDescription = styled.p`
  font-size: 1em;
  color: #444;
`;

function Features() {
  return (
    <FeaturesContainer>
      <Title>Features</Title>
      <Description>Explore the features of CODEV and learn how it can assist you.</Description>
      <FeatureGrid>
        <FeatureCard><FeatureTitle>Feature 1</FeatureTitle><FeatureDescription>Description for feature 1</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 2</FeatureTitle><FeatureDescription>Description for feature 2</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 3</FeatureTitle><FeatureDescription>Description for feature 3</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 4</FeatureTitle><FeatureDescription>Description for feature 4</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 5</FeatureTitle><FeatureDescription>Description for feature 5</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 6</FeatureTitle><FeatureDescription>Description for feature 6</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 7</FeatureTitle><FeatureDescription>Description for feature 7</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 8</FeatureTitle><FeatureDescription>Description for feature 8</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 9</FeatureTitle><FeatureDescription>Description for feature 9</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 10</FeatureTitle><FeatureDescription>Description for feature 10</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 11</FeatureTitle><FeatureDescription>Description for feature 11</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 12</FeatureTitle><FeatureDescription>Description for feature 12</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 13</FeatureTitle><FeatureDescription>Description for feature 13</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 14</FeatureTitle><FeatureDescription>Description for feature 14</FeatureDescription></FeatureCard>
        <FeatureCard><FeatureTitle>Feature 15</FeatureTitle><FeatureDescription>Description for feature 15</FeatureDescription></FeatureCard>
      </FeatureGrid>
    </FeaturesContainer>
  );
}

export default Features;
